int train_velocity_offset(uint32_t train_num, uint32_t train_speed) {
    if (train_speed >= 16) {
        train_speed -=16;
    }
    switch (train_num) {
        case 2:
            switch (train_speed){
                case 0:
                    return 100;
                case 4:
                    return 84;
                case 8:
                    return 88;
                case 12:
                    return 84;
                case 14:
                    return 86;
                default:
                    // unsupported speed
                    return -1;      
            }
        default:
            // train 47 or others
            switch (train_speed){
                case 0:
                    return 100;
                case 4:
                    return 86;
                case 8:
                    return 78;
                case 12:
                    return 86;
                case 14:
                    return 86;
                default:
                    // unsupported speed
                    return -1;      
            }
    }
}

int sensor_distance_between(char track, uint32_t src_sensor, uint32_t dest_sensor) {
    switch (track){
        case 'a':
        case 'A':
            return pcp_dists_a[src_sensor][dest_sensor];

        case 'b':
        case 'B':
            return pcp_dists_b[src_sensor][dest_sensor];
        default:
            return -1;
    }
}
